<style scoped>
* {
  font-family: "montserrat";
}

.app {
  height: 3000px;
  padding-top: 81px;
  background: linear-gradient(252.37deg, #F1F5F9 37.94%, #F4F7FA 100%);
}


header {
  z-index: 10;
  background: #fff;
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  padding: 15px 0;
  transition: 0.5s;
  border-bottom: rgba(244, 247, 250, 1) 1px solid;
}

header.sticky {
  background: rgba(244, 247, 250, 1);
  box-shadow: 0 0 10px rgb(216, 216, 216);
  transition: 0.5s;
  padding: 20px 0;
}

nav {
  display: flex;
  justify-content: space-around;
  height: 73px;
  position: relative;
}

.logoPart {
  display: flex;
  justify-content: center;
  align-items: center;
  text-decoration: none;
  color: rgba(62, 61, 61, 1);
}

.logoText {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin: 0 40px 0 10px;
}

.logoText svg:first-child {
  margin-bottom: 5px;
}

.accounting {
  font-size: 12px;
}

nav ul {
  list-style: none;
  display: flex;
  justify-content: space-between;
  align-items: center;
  max-width: 20vw;
  min-width: 200px;
  width: 100%;
  transition: ease-in-out 0.6s;
}

nav ul li a {
  position: relative;
  text-decoration: none;
  color: rgba(62, 61, 61, 1);
  font-size: 16px;
  font-weight: 500;
}

nav ul li a:hover {
  color: rgba(24, 32, 97, 1);
}

ul li a:after {
  content: "";
  display: block;
  width: 100%;
  height: 1px;
  background: rgba(62, 61, 61, 1);
  position: absolute;
  opacity: 0;
  transition: 0.2s ease-in-out;
}

ul li a:hover:after {
  opacity: 1;
}

.phoneNumber {
  transition: ease-in-out 0.6s;
  display: flex;
  justify-content: space-between;
  align-items: center;
  max-width: 20vw;
  width: 100%;
}

.phoneNumber p {
  font-weight: 600;
  font-size: 14px;
  color: rgba(24, 32, 97, 1);
}

.phoneNumber a {
  text-decoration: none;
  font-weight: 500;
}

.phoneNumber button {
  color: rgba(24, 32, 97, 1);
  display: flex;
  justify-content: center;
  align-items: center;
  margin-left: 20px;
  border: 1px solid rgba(24, 32, 97, 1);
  text-align: center;
  padding: 0 30px 0 30px;
  border-radius: 20px 0 20px 0;
  height: 50px;
  background: #fff;
  font-size: 12px;
}

.phoneNumber button:hover {
  background: rgba(24, 32, 97, 1);
  cursor: pointer;
  transition: 0.3s;
}

.phoneNumber a:hover button {
  color: #fff;
}

/* Burger ******************************************************* */
.icons {
  visibility: hidden;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
  transform: scale(0.15);
  position: absolute;
  top: -120px;
  right: -100px;
  z-index: 50;
}

.icons svg {
  fill-rule: evenodd;
  clip-rule: evenodd;
  stroke-linecap: round;
  stroke-linejoin: round;
  stroke-miterlimit: 1.5;
  cursor: pointer;
}

.icons svg path {
  fill: none;
  stroke: rgba(24, 32, 97, 1);
  stroke-width: 2px;
}


#top,
#bottom {
  stroke-dasharray: 30, 75.39;
  transition: all 0.6s cubic-bezier(0.6, 0.33, 0.67, 1.29);
}

.icons svg.active #top,
.icons svg.active #bottom {
  stroke-dasharray: 75.39;
  stroke-dashoffset: -60;
}

.icons svg:nth-child(2) {
  transform: rotate(0deg);
  transition: transform 0.6s cubic-bezier(0.165, 0.84, 0.44, 1);
}

.icons svg:nth-child(2) path {
  transition: all 0.4s ease-in-out 0.6s;
}

.icons svg:nth-child(2).active {
